import React from 'react'

export default function Todo() {
    return (
        <h3 className="text-dark text-center p-1 bg-light">
            <i className="far fa-times-circle fa-sm float-left m-5 text-danger"></i><span>Task</span><input type="checkbox" className="m-2 float-right"/>
        </h3>
    )
}
